const items = $input.all(); // Get all input items

// Group items by searchQuery
const groupedItems = items.reduce((acc, item) => {
  const searchQuery = item.json.searchQuery || 'default';
  if (!acc[searchQuery]) {
    acc[searchQuery] = [];
  }
  acc[searchQuery].push(item);
  return acc;
}, {});

// Assign positions within each group
const result = Object.values(groupedItems).flatMap(group => 
  group.map((item, index) => ({
    json: {
      ...item.json,
      position: index + 1, // Add the position based on the index within the group
    },
  }))
);

return result; // Return the modified items
